import * as React from 'react';
import { TextField } from '@mui/material';

const Login = () => {
    return(
        <div className='container'>
            <div 
                className='header' 
                style={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center'
                }}>
                <h1>Find My News</h1>
            </div>

            <div
                className='inputs'
                style={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    height: '100vh'
                }}>
                <div className='input'>
                    <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                </div>
            </div>
        </div>
    )
}
export default Login;
